import React from "react";

const NotFound = () => {
  return (
    <>
      <h1 style={{ fontSize: 50, color: "white" }}>Page Not Found</h1>
      <p style={{ fontSize: 50, color: "white" }}>
        Sorry, this page does not exist
      </p>
    </>
  );
};

export default NotFound;
